import octaLogo from "../media/logos/logo-octa.svg";
import gdscLogo from "../media/logos/logo-gdsc.svg";

function Header() {
	return (
		<header id="Header" className="bg-black container mx-auto">
			<div className="grid grid-cols-12 h-20">
				<div className="cols-span-3">
					<img src={octaLogo} alt="" />
				</div>
				<div className="col-span-1"></div>
				<div className="cols-span-4">
					<img src={gdscLogo} alt="" className="h-full" />
				</div>
			</div>
		</header>
	);
}

export default Header;
